import React from 'react'

import './BillingMainContent.scss';

export default function BillingMainContent() {

	const userData = [
		{ username: "Oliver Liam", companyName: "Viking Burrito", emailAddress: "oliver@burrito.com", VATNumber: "FRB1235476" }
	]

	return (
		<>
			<ul className='biling-info-item-wrapper'>
				<div className='box-main-title'>Billing Information</div>
				<li>
					<div className='username-wrapper'>
						<p className='username'>{userData[0].username}</p>
						<ul className='update-setings'>
							<li className='delete-option'> DELETE</li>
							<li className='edit-option'>EDIT</li>
						</ul>
					</div>
				</li>
			</ul>
		</>
	)
}
